// SPDX-License-Identifier: MIT

// Smart contract that lets anyone deposit ETH into the contract
// Only the owner of the contract can withdraw the ETH
pragma solidity ^0.7.0;

// Get the latest ETH/USD price from chainlink price feed

// IMPORTANT: This contract has been updated to use the Goerli testnet
// Please see: https://docs.chain.link/docs/get-the-latest-price/
// For more information

import "@chainlink/contracts/src/v0.7/interfaces/AggregatorV3Interface.sol";

contract FundMe {
    address GOERLI_TESTNET_ETH_USD = 0xD4a33860578De61DBAbDc8BFdb98FD742fA7028e;
    mapping(address => uint) public addrToAmtFunded;

    function fund() public payable {
        // US$ 1
        uint minimUSD = 1 * 10**8;
        require(getConvRate(msg.value) >= minimUSD, "Minimum spending allowed is US$1");
        addrToAmtFunded[msg.sender] += msg.value;
    }

    function getVer() public view returns(uint) {
        AggregatorV3Interface priceFeed = AggregatorV3Interface(GOERLI_TESTNET_ETH_USD);
        return priceFeed.version();
    }

    function getPrice() public view returns(uint) {
        AggregatorV3Interface priceFeed = AggregatorV3Interface(GOERLI_TESTNET_ETH_USD);
        (,int256 answer,,,) = priceFeed.latestRoundData();
        return uint(answer);
    }

    function getConvRate(uint ethAmt) public view returns(uint) {
        uint ethPrice = getPrice();
        uint ethAmtInUsd = (ethPrice * ethAmt) / 10**8;
        return ethAmtInUsd;
    }

    function withdraw() payable public {
        msg.sender.transfer(address(this).balance);
    }
}

